import React from "react";
import Input from "../components/input"

class UserLoginPage extends React.Component{

    state = {
        username: null,
        password: null
    };

    onChange = (event) =>{
        const {name,value} = event.target;
        this.setState({
            [name]: value
        })

    }

    render(){

        const {username,password} = this.state
        return(
            <div className="container">
                <form>
                    <h1>Login</h1>
                    <Input type="text" name="username" label="Username" onChange={this.onChange}/>
                    <Input type="password" name="password" label="Password" onChange={this.onChange}/>
                    <button className="btn btn-primary" disabled={username == null || password == null}>Login</button>
                </form>
            </div>
        )
    }
}

export default UserLoginPage;
